import Head from 'next/head';
import React from 'react';
import Landing from './landing';

interface Props {}

const Main: React.FunctionComponent<Props> = () => {
  return (
    <>
      <Head>
        <title>Flamingo</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <Landing />
    </>
  );
};

export default Main;
